import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  .searchLogo {
    position: absolute;
    left: 46.98%;
    right: 45.47%;
    top: 10.57%;
    bottom: 88.07%;

    font-family: Roboto;
    font-style: normal;
    font-weight: bold;
    font-size: 24px;
    line-height: 28px;
    display: flex;
    align-items: center;
    text-align: center;

    color: #000000;
  }
`;

const SearchLogo = (props) => { // 독서 모임 찾기 => { 아이콘 + 독서 모임 찾기 }
  return <>
    <Wrapper>
      <div className="searchLogo">독서 모임 찾기</div>
    </Wrapper>
  </>;
};

export default SearchLogo;
